    class CamPosCtrl implements tesserxel.util.ctrl.IController {
        cameraCtrl: tesserxel.util.ctrl.KeepUpController;
        constructor(cameraCtrl: tesserxel.util.ctrl.KeepUpController) {
            this.cameraCtrl = cameraCtrl;
        }
        update(state: tesserxel.util.ctrl.ControllerState): void {
            const cam = this.cameraCtrl.object;
            if (state.isKeyHold("AltLeft")) return;
            if (state.isKeyHold(".Digit1")) {
                cam.position.set(0, 0.7, 0, 0);
                cam.rotation.l.set();
                cam.rotation.r.set();
                (cam as tesserxel.four.PerspectiveCamera).fov = 50;
                this.cameraCtrl.updateObj();
            }
            if (state.isKeyHold(".Digit2")) {
                cam.position.set(2, 0.7, 0, -2.5);
                cam.rotation.l.set();
                cam.rotation.r.set();
                cam.rotatesb(Bivec.wx.mulf(Math.PI / 2));
                this.cameraCtrl.updateObj();
                (cam as tesserxel.four.PerspectiveCamera).fov = 90;
            }

            if (state.isKeyHold(".Digit3")) {
                cam.position.set(0, 3, 0, -2.5);
                cam.rotation.l.set();
                cam.rotation.r.set();
                cam.rotatesb(Bivec.yw.mulf(Math.PI / 2));
                cam.rotatesb(Bivec.wx.mulf(Math.PI / 2));
                this.cameraCtrl.updateObj();
                (cam as tesserxel.four.PerspectiveCamera).fov = 90;
            }
        }
    }
    class BallEmitter implements tesserxel.util.ctrl.IController {
        glomeRadius = 0.22; mass = 6;
        glomeGeom = new FOUR.GlomeGeometry(this.glomeRadius);
        glomeMaterial = new FOUR.PhongMaterial(
            new FOUR.WgslTexture(`fn map(coord:vec4f)->vec4f{
                let uvw = normalize(coord);
    const a = normalize(vec4f(1,1,1,3));
    const b = normalize(vec4f(1,-1,-1,3));
    const c = normalize(vec4f(-1,1,-1,3));
    const d = normalize(vec4f(-1,-1,1,3));
    const thr = 0.985;
    if(dot(uvw,a)>thr||dot(uvw,b)>thr||dot(uvw,c)>thr||dot(uvw,d)>thr){
        return vec4f(0,0,0,1);
    }else{
        return vec4f(0.5, 0.4, 0.2, 0.5);
    }
}`, "map"), 10
        );
        enabled: boolean = true;
        world: tesserxel.physics.World; scene: tesserxel.four.Scene;
        camera: tesserxel.math.Obj4;
        initialSpeed = 5;
        bridge = new Map<tesserxel.physics.Rigid, tesserxel.four.Mesh>;
        constructor(world: tesserxel.physics.World, scene: tesserxel.four.Scene, camera: tesserxel.math.Obj4) {
            this.world = world; this.scene = scene; this.camera = camera;
            this.glomeGeom.jsBuffer.setUVWAsPosition();
        }
        update(state: tesserxel.util.ctrl.ControllerState): void {
            for (const [g, m] of this.bridge.entries()) {
                m.copyObj4(g);
            }
            if (state.isKeyHold("AltLeft")) return;
            if (this.camera.position.w < 0) return;
            if (state.isPointerLocked() && state.mouseDown === 0) {
                let g = new PHY.Rigid({
                    geometry: new PHY.rigid.Glome(this.glomeRadius),
                    material: new PHY.Material(0.5, 0.1), mass: this.mass
                });
                g.position.copy(this.camera.position);
                g.position.y -= 0.5;
                g.velocity.copy(Vec4.wNeg.rotate(this.camera.rotation).mulfs(this.initialSpeed));
                g.angularVelocity.xw = 3;
                let m = new FOUR.Mesh(this.glomeGeom, this.glomeMaterial);
                this.bridge.set(g, m);
                m.alwaysUpdateCoord = true;
                this.world.add(g);
                this.scene.add(m);
            }
        }
        count() {
            return this.bridge.size;
        }
    }
    class PinMgr {
        geom: tesserxel.four.Geometry;
        material = new FOUR.LambertMaterial(new FOUR.WgslTexture(`
fn pin(uvw:vec4f)->vec4f{
    if((uvw.y>0.18&&uvw.y<0.2)||(uvw.y>0.23&&uvw.y<0.25)) {return vec4f(1,0,0,1);}else{ return vec4f(1,1,1,1);}
}`, "pin"));
        convexPointData: tesserxel.math.Vec4[];
        mass = 1.5;
        world: tesserxel.physics.World; scene: tesserxel.four.Scene;
        bridge = new Map<tesserxel.physics.Rigid, tesserxel.four.Mesh>();
        first = true;

        initialObj4: tesserxel.math.Obj4[] = [];
        async init() {
            const pin3D = new tesserxel.mesh.FaceIndexMesh(
                new tesserxel.mesh.ObjFile(await (await (fetch("resource/bowl_pin_mesh.obj"))).text()).parse()
            ).toNonIndexMesh();
            const pin4D = tesserxel.mesh.tetra.rotatoid(
                tesserxel.math.Bivec.wz, pin3D, 10
            ).setUVWAsPosition();
            this.convexPointData = pin4D.toIndexMesh().getVertices();
            this.geom = new FOUR.Geometry(
                pin4D
            );
            return this;
        }
        build(world: tesserxel.physics.World, scene: tesserxel.four.Scene, positions: tesserxel.math.Vec3[]) {
            this.world = world; this.scene = scene;
            for (const p of positions) {
                let pos = p.mulf(0.4);
                let g = new PHY.Rigid({
                    geometry: new PHY.rigid.Convex(this.convexPointData.map(e => e.clone())),
                    material: new PHY.Material(0.5, 0.5), mass: this.mass
                });
                if (this.first) {
                    this.first = false;
                    this.geom.jsBuffer.applyObj4(new Obj4(null, g.rotation.conj()));
                }
                g.position.set(pos.x, 0.4, pos.y, -pos.z - 2);
                let m = new FOUR.Mesh(this.geom, this.material);
                this.bridge.set(g, m);
                m.alwaysUpdateCoord = true;
                this.world.add(g);
                this.scene.add(m);
                this.initialObj4.push(new Obj4().copyObj4(g));
            }
        }
        restart() {
            let i = 0;
            for (const g of this.bridge.keys()) {
                g.copyObj4(this.initialObj4[i++]);
                g.velocity.set();
                g.angularVelocity.set();
            }
        }
        count() {
            let sum = 0;
            for (const m of this.bridge.values()) {
                sum += (m.position.y < 0.3) ? 1 : 0;
            }
            return sum;
        }
        countDetail() {
            const table = []; let i = 0;
            for (const m of this.bridge.values()) {
                if (m.position.y < 0.3) { table.push(i); }
                i++;
            }
            return table;
        }
        update() {
            for (const [g, m] of this.bridge.entries()) {
                m.copyObj4(g);
            }
        }
    }
    class Score {
        dom: HTMLDivElement;
        total: number;
        constructor(total: number) {
            const dom = document.createElement('div');
            dom.textContent = "0/" + total;
            dom.style.position = 'fixed';
            dom.style.top = '50%';
            dom.style.left = '0';
            dom.style.fontSize = '2em';
            dom.style.color = "white";
            document.body.appendChild(dom);
            this.dom = dom;
            this.total = total;
        }
        update(pincount: number, rollcount: number) {
            this.dom.textContent = pincount + "/" + this.total + " (roll:" + rollcount + ")"
        }
    }
